import React from 'react';
import { useNavigate } from 'react-router-dom';
import logo from '../assets/logo.png';

function Interface3() {
  const navigate = useNavigate();

  const handleBackClick = () => {
    navigate('/Interface2'); // Revenir à la page précédente
  };

  const goToInterface4 = () => {
    navigate('/Interface4');  // Navigue vers l'interface 4
  };

  return (
    <div style={{ padding: '20px' }}>
      <NavBar /*progress={66} debit={15} *//> {/* Exemples de valeurs pour la barre de progression et le débit */}
      <div style={{ marginBottom: '20px', cursor: 'pointer', color: 'black' }} onClick={handleBackClick}>
        &lt;Back
      </div>
      <div style={{ textAlign: 'center' }}>
        <h2>À quelle fréquence votre famille utilise-t-elle le chat vidéo ou fait-elle des appels téléphoniques sur Internet?</h2>
        <p>(Skype, Messenger, Google Hangouts, FaceTime, etc.)</p>
        <button className="survey-btn" onClick={goToInterface4}>Rarement</button>
        <button className="survey-btn" onClick={goToInterface4}>Hebdomadairement</button>
        <button className="survey-btn" onClick={goToInterface4}>Tous les jours</button>
      </div>
    </div>
  );
}

function NavBar() {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', backgroundColor: '#333', color: '#fff', padding: '10px' }}>
      <img src={logo} alt="Topnet Logo" style={{ height: '40px' }} />
      <ProgressBar progress={66} />  {/* Exemples */}
      <div style={{ fontSize: '20px' }}>15 Mbps</div>  {/* Exemple de débit */}
    </div>
  );
}

function ProgressBar({ progress }) {
  return (
    <div style={{ width: '50%', backgroundColor: '#444', borderRadius: '5px' }}>
      <div style={{ width: `${progress}%`, backgroundColor: '#ff4081', height: '10px', borderRadius: '5px' }}></div>
    </div>
  );
}

export default Interface3;
